const CHARACTERS = {
    FIRST: [ 'ㄱ', 'ㄲ', 'ㄴ', 'ㄷ', 'ㄸ', 'ㄹ', 'ㅁ', 'ㅂ', 'ㅃ', 'ㅅ', 'ㅆ', 'ㅇ', 'ㅈ', 'ㅉ', 'ㅊ', 'ㅋ', 'ㅌ', 'ㅍ', 'ㅎ' ],
    MIDDLE: [ 'ㅏ', 'ㅐ', 'ㅑ', 'ㅒ', 'ㅓ', 'ㅔ', 'ㅕ', 'ㅖ', 'ㅗ', 'ㅘ', 'ㅙ', 'ㅚ', 'ㅛ', 'ㅜ', 'ㅝ', 'ㅞ', 'ㅟ', 'ㅠ', 'ㅡ', 'ㅢ', 'ㅣ' ],
    LAST: [ '', 'ㄱ', 'ㄲ', 'ㄳ', 'ㄴ', 'ㄵ', 'ㄶ', 'ㄷ', 'ㄹ', 'ㄺ', 'ㄻ', 'ㄼ', 'ㄽ', 'ㄾ', 'ㄿ', 'ㅀ', 'ㅁ', 'ㅂ', 'ㅄ', 'ㅅ', 'ㅆ', 'ㅇ', 'ㅈ', 'ㅊ', 'ㅋ', 'ㅌ', 'ㅍ', 'ㅎ' ],
    ㄴtoㅇ: [ 'ㅕ', 'ㅛ', 'ㅠ', 'ㅣ' ],
    ㄹtoㄴ: [ 'ㅏ', 'ㅐ', 'ㅗ', 'ㅚ', 'ㅜ', 'ㅡ' ],
    ㄹtoㅇ: [ 'ㅑ', 'ㅕ', 'ㅖ', 'ㅛ', 'ㅠ', 'ㅣ' ]
};

const WORDSORTER = function(a, b) {
    return a.length - b.length;
};

window.onload = function() {
    document.getElementById("search").onclick = function () {
        var input = document.getElementById("start");
        var toSearch = input.value;

        if (toSearch.length != 1) {
            alert("비정상적인 시작음절입니다.");
            return;
        }

        var charCode = toSearch[0].charCodeAt(0);

        var attack = document.getElementById("attack");
        var weakAttack = document.getElementById("weakAttack");
        var feelAttack = document.getElementById("feelAttack");
        var defense = document.getElementById("defense");
        var middleAttack = document.getElementById("middleAttack");
        var subAttack1 = document.getElementById("subAttack1");
        var subAttack2 = document.getElementById("subAttack2");
        var mirrorAttack = document.getElementById("mirrorAttack");
        var oneAttack = document.getElementById("oneAttack");
        attack.innerHTML = "";
        weakAttack.innerHTML = "";
        feelAttack.innerHTML = "";
        defense.innerHTML = "";
        middleAttack.innerHTML = "";
        subAttack1.innerHTML = "";
        subAttack2.innerHTML = "";
        mirrorAttack.innerHTML = "";
        oneAttack.innerHTML = "";

        doThing(toSearch, '');

        if (charCode >= 0xAC00 && charCode <= 0xD7A3) {
            charCode -= 0xAC00;
            var last = charCode % 28;
            var middle = ((charCode - last) / 28) % 21;
            var first = (((charCode - last) / 28) - middle) / 21;

            checkBlock: {
                if (CHARACTERS.FIRST[first] == 'ㄴ') {
                    if (CHARACTERS.ㄴtoㅇ.indexOf(CHARACTERS.MIDDLE[middle]) != -1)
                        first = CHARACTERS.FIRST.indexOf('ㅇ');
                    else
                        break checkBlock;
                } else if (CHARACTERS.FIRST[first] == 'ㄹ') {
                    if (CHARACTERS.ㄹtoㄴ.indexOf(CHARACTERS.MIDDLE[middle]) != -1)
                        first = CHARACTERS.FIRST.indexOf('ㄴ');
                    else if (CHARACTERS.ㄹtoㅇ.indexOf(CHARACTERS.MIDDLE[middle]) != -1)
                        first = CHARACTERS.FIRST.indexOf('ㅇ');
                    else
                        break checkBlock;
                } else
                    break checkBlock;
                doThing(String.fromCharCode(last + 28 * middle + 21 * 28 * first + 0xAC00), ' ');
            }

        }

        function doThing(toSearch, blank) {
            if (ATTACK_MAP[toSearch] != null && ATTACK_MAP[toSearch].length > 0)
                attack.innerHTML += blank + ATTACK_MAP[toSearch].sort(WORDSORTER).join(' ');
            if (WEAKATTACK_MAP[toSearch] != null && WEAKATTACK_MAP[toSearch].length > 0)
                weakAttack.innerHTML += blank + WEAKATTACK_MAP[toSearch].sort(WORDSORTER).join(' ');
            if (FEELATTACK_MAP[toSearch] != null && FEELATTACK_MAP[toSearch].length > 0)
                feelAttack.innerHTML += blank + FEELATTACK_MAP[toSearch].sort(WORDSORTER).join(' ');
            if (MIDDLEATTACK_MAP[toSearch] != null && MIDDLEATTACK_MAP[toSearch].length > 0)
                middleAttack.innerHTML = blank + MIDDLEATTACK_MAP[toSearch].sort(WORDSORTER).join(' ');
            if (SUBATTACK1_MAP[toSearch] != null && SUBATTACK1_MAP[toSearch].length > 0)
                subAttack1.innerHTML += blank + SUBATTACK1_MAP[toSearch].sort(WORDSORTER).join(' ');
            if (SUBATTACK2_MAP[toSearch] != null && SUBATTACK2_MAP[toSearch].length > 0)
                subAttack2.innerHTML += blank + SUBATTACK2_MAP[toSearch].sort(WORDSORTER).join(' ');
            if (MIRRORATTACK_MAP[toSearch] != null && MIRRORATTACK_MAP[toSearch].length > 0)
                mirrorAttack.innerHTML += blank + MIRRORATTACK_MAP[toSearch].sort(WORDSORTER).join(' ');
            if (ONEATTACK_MAP[toSearch] != null && ONEATTACK_MAP[toSearch].length > 0)
                oneAttack.innerHTML += blank + ONEATTACK_MAP[toSearch].sort(WORDSORTER).join(' ');
            if (DEFENSE_MAP[toSearch] != null && DEFENSE_MAP[toSearch].length > 0)
                defense.innerHTML += blank + DEFENSE_MAP[toSearch].sort(WORDSORTER).join(' ');
            else if (WEAKDEFENSE_MAP[toSearch] != null && WEAKDEFENSE_MAP[toSearch].length > 0)
                defense.innerHTML += blank + WEAKDEFENSE_MAP[toSearch].sort(WORDSORTER).join(' ');
            else if (MIDDLEDEFENSE_MAP[toSearch] != null && MIDDLEDEFENSE_MAP[toSearch].length > 0)
                defense.innerHTML += blank + MIDDLEDEFENSE_MAP[toSearch].sort(WORDSORTER).join(' ');
            else if (SUBDEFENSE1_MAP[toSearch] != null && SUBDEFENSE1_MAP[toSearch].length > 0)
                defense.innerHTML += blank + SUBDEFENSE1_MAP[toSearch].sort(WORDSORTER).join(' ');
            else if (SUBDEFENSE2_MAP[toSearch] != null && SUBDEFENSE2_MAP[toSearch].length > 0)
                defense.innerHTML += blank + SUBDEFENSE2_MAP[toSearch].sort(WORDSORTER).join(' ');
            else if (MIRRORDEFENSE_MAP[toSearch] != null && MIRRORDEFENSE_MAP[toSearch].length > 0)
                defense.innerHTML += blank + MIRRORDEFENSE_MAP[toSearch].sort(WORDSORTER).join(' ');
        }
    };
};
